import React from "react";

const Footer = () =>{
    return(
        <>
        <div className="container-fluid">
            <div className="row">
                <div className="col-10 mx-auto">
                    <footer className="w-100 bg-secondary text-center">
                        <p>2021 BlueSky. All Rights Reserved | Terms and condition</p>
                    </footer>
                </div>
            </div>
        </div>
        </>
    )
}
export default Footer;
